        {id: 3, name: 'Sveta'},
        {id: 4, name: 'Katya'},
        {id: 5, name: 'Olya'}
    ],
    messages :  [
        {id: 1, message: 'hi'},
        {id: 2, message: 'yo'},
        {id: 3, message: 'hello'},
        {id: 4, message: 'ky'},
        {id: 5, message: 'privet'}
